import React, { useState } from 'react';
import { Form, Button } from 'react-bootstrap';
import "../components/Form.css"
import { signUpForm } from './style'

const OwnerSearch = () => {
    const [inputValue, setInputValue] = useState('');

    const handleSubmit = (event) => {
        event.preventDefault();
        // Do something with the submitted value
    };

    const handleInputChange = (event) => {
        setInputValue(event.target.value);
    };

    return (
        <div class="signUpForm">
            <Form onSubmit={handleSubmit}>
                <Form.Group controlId="formInput">
                    <Form.Label>Search for Home by User</Form.Label>
                    <Form.Control type="text" placeholder="Enter a value" value={inputValue} onChange={handleInputChange} />
                </Form.Group>
                <div class="col-sm-10">
                    <Button type="submit" className="mt-3">Submit</Button>
                </div>
            </Form>
        </div>
    );
};

export default OwnerSearch;
